        Lieu d\xe9part vers le site : la ville du Kef (fig.2).\n-\tDistance \xe0 parcourir\
        \ : environ 14 km\n-\tManque de signal\xe9tique\n-\tSentiers d\u2019acc\xe8\
        s au site non am\xe9nag\xe9s\n-\tRisque de disparition par l\u2019alt\xe9\
        ration et l\u2019action de l\u2019homme\n-\tPour pr\xe9server le site il est\
        \ formellement interdit de pr\xe9lever des \xe9chantillons de la roche verte.\
        \ \n\n**III.\tDescriptif du site**\n\n**1. Int\xe9r\xeat de la visite du site**\n\
        \n**Le paysage** : \n\n-\tUn tr\xe8s beau site, propre et sans pollution quelconque\
        \ ; \n-\tUne for\xeat de pin d\u2019Alep verdoyante ; \n-\tUne route bien\
        \ entretenue qui m\xe8ne vers Hammam Mell\xe8gue ;\n-\t Une vue panoramique\
        \ exceptionnelle avec la vall\xe9e de l\u2019Oued Mell\xe8gue et les Vastes\
        \ champs agricoles et for\xeats de pins d\u2019Alep qui l\u2019entoure et\
        \ qui s\u2019\xe9tendent \xe0 perte de vue vers le NE. \n\n**G\xe9ologie**\
        \ :\n\n Le Trias affleurant sur le rebord gauche de la route vers Hammam Mell\xe8\
        gue   est constitu\xe9 par une \xe9paisse s\xe9rie gypseuse de couleur blanch\xe2\
        tre englobant des blocs de dolomies grises \xe0 noires, des argiles grises,\
        \ des niveaux gr\xe9seux, d\xe9pos\xe9e entre -245 \xe0 -205 Ma. \n\nCes s\xe9\
        ries, d\u2019aspect chaotique (m\xe9lang\xe9) et pauvres en fossiles caract\xe9\
        ristiques,  ne permettent pas d\u2019y \xe9tablir une succession stratigraphique\
        \ repr\xe9sentative.\n\nLa s\xe9rie triasique renferme un \xe9pais affleurement\
        \ de roches vertes ou ophites correspondant \xe0 des coul\xe9es de laves basaltiques.\
        \ \n\nLes ophites doivent leur nom \xe0 leur couleur verts tr\xe8s caract\xe9\
        ristique.\n\nCes roches vertes se pr\xe9sentent soit en coul\xe9es plus ou\
        \ moins allong\xe9e soit en coussins ou en pillow lavas (photo 4). \n\n**2.\
        \ R\xe9sum\xe9 des informations importantes \xe0 retenir** : \n\nLa nature\
        \ des terrains triasiques dans la r\xe9gion du Kef, essentiellement \xe9vaporitique\
        \ (gypse, sel gemme, halite) et dolomitique, indique que leur d\xe9p\xf4t\
        \ s\u2019est effectu\xe9 dans un environnement de Sebkha et Lagunes. Les ophites,\
        \ fr\xe9quentes dans les d\xe9p\xf4ts triasiques, indiquent que la r\xe9gion\
        \ f\xfbt le si\xe8ge d\u2019une activit\xe9 volcanique de type continental.\
        \ Ce volcanisme est un \xe9cho lointain du d\xe9chirement partiel de la cro\xfb\
        te continentale de la Terre en sillons pr\xe9-oc\xe9aniques par rifting dans\
        \ un contexte de divergence des plaques tectoniques (Wikip\xe9dia)\nIV.\t\
        En savoir plus : \n\n**R\xe9f\xe9rences bibliographiques**\nMohamed Soussi\
